#include <bits/stdc++.h>
using namespace std;
int n;
int x;
vector <int> v;
int main(){
    cin>>n;
    for(int i=1;i<=n;i++){
        scanf("%d",&x);
        v.push_back(x);
    }
    //寻找任意两个不同的数字，然后删掉
    for(int i=0;i<v.size();i++){
        for(int j=i+1;j<v.size();j++){
            if(v[i]!=v[j]){
                // cout<<v[i]<<" "<<v[j]<<endl;
                v.erase(v.begin()+i);
                v.erase(v.begin()+j-1);
                break;
            }
        }
    }
    cout<<v[0];
    return 0;
}
